import App2 from './App2'
import Login from "./components/Login";
//import Tareas from './pages/Tareas/Tareas';

const App = () => {
  const [token, setToken] = useState();

  if(!token) {
    return <Login setToken={setToken} />
  }
  
  return (
    <div>
      <App2 />
    </div>
  );
}

export default App;
